{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/dayyak/cyclistic-rider-behavior-analysis?scriptVersionId=246144509\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"62c148e2","metadata":{"papermill":{"duration":0.012022,"end_time":"2025-06-18T13:13:37.901998","exception":false,"start_time":"2025-06-18T13:13:37.889976","status":"completed"},"tags":[]},"source":["# 1. Introduction\n","Cyclistic is seeking to grow its business by increasing the number of annual memberships. Rather than focusing solely on digital campaigns to attract new users, the company believes that converting casual riders into loyal annual members offers a more sustainable path to success. To support this strategy, the analysis team has been tasked with answering the key question:\n","\n","**“How do casual riders and annual members behave differently?”**\n","\n","The objective is to uncover patterns, trends, and insights in rider behavior that can inform marketing, operational and membership strategies. This case-study presents data-driven findings along with actionable recommendations to help stakeholders make informed decisions aimed at boosting annual membership conversions."]},{"cell_type":"markdown","id":"a4f7974c","metadata":{"papermill":{"duration":0.011423,"end_time":"2025-06-18T13:13:37.924504","exception":false,"start_time":"2025-06-18T13:13:37.913081","status":"completed"},"tags":[]},"source":["### Key Stakeholders\n"," - **Lily Moreno (marketing director):** Responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n","\n"," - **Marketing analytics team:** Responsible for collecting, analyzing, and reporting data that helps guide Cyclistic's marketing strategy.\n","\n"," - **Cyclistic executive team:** Deciding whether to approve the recommended marketing program.\n","\n"," - **Riders:**\n","    * *Casual riders:* occasional users who pay per ride/daily (single-ride or ful-day passes).\n","\n","    * *Members:* regular users who pay a monthly or annual.(Cyclistic members)\n"]},{"cell_type":"markdown","id":"88af2067","metadata":{"papermill":{"duration":0.011121,"end_time":"2025-06-18T13:13:37.946552","exception":false,"start_time":"2025-06-18T13:13:37.935431","status":"completed"},"tags":[]},"source":["# 2. Data Preparation\n","**Data Source Description:**\n","The dataset consists of multiple .csv files covering the years 2019 and 2020, with one file provided for each quarter (Q1 to Q4). These files contain detailed trip-level data, including start and end times, station locations, user types, and ride durations. \n","\n","- Divvy_Trips_2019_Q1.csv\t\n","- Divvy_Trips_2019_Q2.csv\t\n","- Divvy_Trips_2019_Q3.csv\t\n","- Divvy_Trips_2019_Q4.csv\n","\n","- Divvy_Trips_2020_Q1.csv\t\n","- Divvy_Trips_2020_Q2.csv\t\n","- Divvy_Trips_2020_Q3.csv\n","- Divvy_Trips_2020_Q4.csv"]},{"cell_type":"markdown","id":"9099afd0","metadata":{"papermill":{"duration":0.011101,"end_time":"2025-06-18T13:13:37.968562","exception":false,"start_time":"2025-06-18T13:13:37.957461","status":"completed"},"tags":[]},"source":["**This phase involves a series of sequential steps to prepare and organize the data for the next stage, the \"Processing Phase.\" The key steps include:**\n","\n","1. **Load Data:** Loading the datasets required for this analysis.\n","3. **Standardize/Clean Columns:** Preparing the data structure to enable smooth merging. This involves standardizing column names across all datasets to prevent errors during the merge process. Additionally, unnecessary columns are excluded to streamline the data and focus only on relevant information.\n","4. **Merge Datasets:** Merging the datasets to simplify data handling by grouping related data together. The merging strategy may vary depending on the analysis context — such as by time period or category. In this case, I have aggregated the datasets by year to align with the analysis objective."]},{"cell_type":"code","execution_count":1,"id":"39583a9b","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:13:37.996335Z","iopub.status.busy":"2025-06-18T13:13:37.994321Z","iopub.status.idle":"2025-06-18T13:13:39.897953Z","shell.execute_reply":"2025-06-18T13:13:39.895985Z"},"papermill":{"duration":1.920225,"end_time":"2025-06-18T13:13:39.900567","exception":false,"start_time":"2025-06-18T13:13:37.980342","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.5\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.1\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.5.1     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.3     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.1\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.2     \n"]},{"name":"stderr","output_type":"stream","text":["── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n"]},{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘janitor’\n","\n","\n"]},{"name":"stderr","output_type":"stream","text":["The following objects are masked from ‘package:stats’:\n","\n","    chisq.test, fisher.test\n","\n","\n"]},{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘data.table’\n","\n","\n"]},{"name":"stderr","output_type":"stream","text":["The following objects are masked from ‘package:lubridate’:\n","\n","    hour, isoweek, mday, minute, month, quarter, second, wday, week,\n","    yday, year\n","\n","\n"]},{"name":"stderr","output_type":"stream","text":["The following objects are masked from ‘package:dplyr’:\n","\n","    between, first, last\n","\n","\n"]},{"name":"stderr","output_type":"stream","text":["The following object is masked from ‘package:purrr’:\n","\n","    transpose\n","\n","\n"]}],"source":["# Import Libraries\n","\n","library(tidyverse)    \n","library(lubridate)   \n","library(skimr)      \n","library(knitr)\n","library(ggrepel)      \n","library(RColorBrewer)           \n","library(janitor)      \n","library(data.table) \n","library(dplyr)\n","library(stringr)\n","library(ggplot2)\n","library(patchwork) "]},{"cell_type":"markdown","id":"09502f30","metadata":{"papermill":{"duration":0.011058,"end_time":"2025-06-18T13:13:39.923287","exception":false,"start_time":"2025-06-18T13:13:39.912229","status":"completed"},"tags":[]},"source":["## 2.1 Data Loading"]},{"cell_type":"code","execution_count":2,"id":"0628e1bd","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:13:39.977784Z","iopub.status.busy":"2025-06-18T13:13:39.947424Z","iopub.status.idle":"2025-06-18T13:15:25.983245Z","shell.execute_reply":"2025-06-18T13:15:25.981458Z"},"papermill":{"duration":106.051803,"end_time":"2025-06-18T13:15:25.986235","exception":false,"start_time":"2025-06-18T13:13:39.934432","status":"completed"},"tags":[]},"outputs":[],"source":["# Loading Data\n","\n","df_2019_q1 <- read.csv(\"/kaggle/input/divvy-trips-data-20192020/Divvy_Trips_2019_Q1.csv\")\n","df_2019_q2 <- read.csv(\"/kaggle/input/divvy-trips-data-20192020/Divvy_Trips_2019_Q2.csv\")\n","df_2019_q3 <- read.csv(\"/kaggle/input/divvy-trips-data-20192020/Divvy_Trips_2019_Q3.csv\")\n","df_2019_q4 <- read.csv(\"/kaggle/input/divvy-trips-data-20192020/Divvy_Trips_2019_Q4.csv\")\n","\n","df_2020_q1 <- read.csv(\"/kaggle/input/divvy-trips-data-20192020/Divvy_Trips_2020_Q1.csv\")\n","df_2020_q2 <- read.csv(\"/kaggle/input/divvy-trips-data-20192020/Divvy_Trips_2020_Q2.csv\")\n","df_2020_q3 <- read.csv(\"/kaggle/input/divvy-trips-data-20192020/Divvy_Trips_2020_Q3.csv\")\n","df_2020_q4 <- read.csv(\"/kaggle/input/divvy-trips-data-20192020/Divvy_Trips_2020_Q4.csv\")"]},{"cell_type":"markdown","id":"4bdcd861","metadata":{"papermill":{"duration":0.010688,"end_time":"2025-06-18T13:15:26.014052","exception":false,"start_time":"2025-06-18T13:15:26.003364","status":"completed"},"tags":[]},"source":["## 2.2 Column Standardization\n","The **df_2019_q2** file contained column names that were inconsistent with the other quarterly datasets. To ensure smooth merging and avoid errors during the data consolidation and analysis process, I renamed its variables\n","to match the structure and naming conventions used in the other data files."]},{"cell_type":"code","execution_count":3,"id":"8e753c06","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:15:26.039337Z","iopub.status.busy":"2025-06-18T13:15:26.037814Z","iopub.status.idle":"2025-06-18T13:15:26.06284Z","shell.execute_reply":"2025-06-18T13:15:26.061084Z"},"papermill":{"duration":0.04089,"end_time":"2025-06-18T13:15:26.065815","exception":false,"start_time":"2025-06-18T13:15:26.024925","status":"completed"},"tags":[]},"outputs":[],"source":["df_2019_q2 <- df_2019_q2 %>%\n","  rename(\n","    bikeid = 'X01...Rental.Details.Bike.ID',\n","    trip_id = 'X01...Rental.Details.Rental.ID',\n","    start_time = 'X01...Rental.Details.Local.Start.Time',\n","    end_time = 'X01...Rental.Details.Local.End.Time',\n","    from_station_id = 'X03...Rental.Start.Station.ID',\n","    from_station_name = 'X03...Rental.Start.Station.Name',\n","    to_station_id = 'X02...Rental.End.Station.ID',\n","    to_station_name = 'X02...Rental.End.Station.Name',\n","    tripduration = 'X01...Rental.Details.Duration.In.Seconds.Uncapped',\n","    birthyear =  'X05...Member.Details.Member.Birthday.Year',\n","    usertype = 'User.Type',\n","    gender = 'Member.Gender'  \n","  )"]},{"cell_type":"code","execution_count":4,"id":"6ffe07c0","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:15:26.093569Z","iopub.status.busy":"2025-06-18T13:15:26.09206Z","iopub.status.idle":"2025-06-18T13:15:26.137535Z","shell.execute_reply":"2025-06-18T13:15:26.135858Z"},"papermill":{"duration":0.062699,"end_time":"2025-06-18T13:15:26.140582","exception":false,"start_time":"2025-06-18T13:15:26.077883","status":"completed"},"tags":[]},"outputs":[],"source":["# Exclude Unshared columns\n","df_2019_q1 <- df_2019_q1 %>% \n"," select(-trip_id, -tripduration, -birthyear)\n","df_2019_q2 <- df_2019_q2 %>% \n"," select(-trip_id, -tripduration, -birthyear)\n","df_2019_q3 <- df_2019_q3 %>% \n"," select(-trip_id, -tripduration, -birthyear)\n","df_2019_q4 <- df_2019_q4 %>% \n"," select(-trip_id, -tripduration, -birthyear)\n","\n","df_2020_q1 <- df_2020_q1 %>% \n","select(-ride_id, -rideable_type, -start_lat, -start_lng, -end_lat, -end_lng)\n","df_2020_q2 <- df_2020_q2 %>% \n","select(-X, -ride_id, -rideable_type, -start_lat, -start_lng, -end_lat, -end_lng)\n","df_2020_q3 <- df_2020_q3 %>% \n","select(-X, -ride_id, -rideable_type, -start_lat, -start_lng, -end_lat, -end_lng)\n","df_2020_q4 <- df_2020_q4 %>% \n","select(-X, -ride_id, -rideable_type, -start_lat, -start_lng, -end_lat, -end_lng)"]},{"cell_type":"code","execution_count":5,"id":"19448ec8","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:15:26.166302Z","iopub.status.busy":"2025-06-18T13:15:26.164735Z","iopub.status.idle":"2025-06-18T13:15:26.220566Z","shell.execute_reply":"2025-06-18T13:15:26.218423Z"},"papermill":{"duration":0.072762,"end_time":"2025-06-18T13:15:26.224576","exception":false,"start_time":"2025-06-18T13:15:26.151814","status":"completed"},"tags":[]},"outputs":[],"source":["# Rename 2019 columns\n","df_2019_q1 <- df_2019_q1 %>%\n","  rename(bike_id = bikeid, user_type = usertype)\n","df_2019_q2 <- df_2019_q2 %>%\n","  rename(bike_id = bikeid, user_type = usertype)\n","df_2019_q3 <- df_2019_q3 %>%\n","  rename(bike_id = bikeid, user_type = usertype)\n","df_2019_q4 <- df_2019_q4 %>%\n","  rename(bike_id = bikeid, user_type = usertype)\n","\n","# Rename 2020 columns\n","df_2020_q1 <- df_2020_q1 %>%\n","  rename(\n","    start_time = started_at,\n","    end_time = ended_at,\n","    from_station_id = start_station_id,\n","    from_station_name = start_station_name,\n","    to_station_id = end_station_id,\n","    to_station_name = end_station_name,\n","    user_type = member_casual\n","  )\n","\n","df_2020_q2 <- df_2020_q2 %>%\n","  rename(\n","    start_time = started_at,\n","    end_time = ended_at,\n","    from_station_id = start_station_id,\n","    from_station_name = start_station_name,\n","    to_station_id = end_station_id,\n","    to_station_name = end_station_name,\n","    user_type = member_casual\n","  )\n","\n","df_2020_q3 <- df_2020_q3 %>%\n","  rename(\n","    start_time = started_at,\n","    end_time = ended_at,\n","    from_station_id = start_station_id,\n","    from_station_name = start_station_name,\n","    to_station_id = end_station_id,\n","    to_station_name = end_station_name,\n","    user_type = member_casual\n","  )\n","\n","df_2020_q4 <- df_2020_q4 %>%\n","  rename(\n","    start_time = started_at,\n","    end_time = ended_at,\n","    from_station_id = start_station_id,\n","    from_station_name = start_station_name,\n","    to_station_id = end_station_id,\n","    to_station_name = end_station_name,\n","    user_type = member_casual\n","  )"]},{"cell_type":"markdown","id":"775dbe5c","metadata":{"papermill":{"duration":0.011172,"end_time":"2025-06-18T13:15:26.246946","exception":false,"start_time":"2025-06-18T13:15:26.235774","status":"completed"},"tags":[]},"source":["## 2.3 Dataset Integration"]},{"cell_type":"code","execution_count":6,"id":"45252687","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:15:26.274931Z","iopub.status.busy":"2025-06-18T13:15:26.272861Z","iopub.status.idle":"2025-06-18T13:15:31.059052Z","shell.execute_reply":"2025-06-18T13:15:31.057145Z"},"papermill":{"duration":4.804486,"end_time":"2025-06-18T13:15:31.062975","exception":false,"start_time":"2025-06-18T13:15:26.258489","status":"completed"},"tags":[]},"outputs":[],"source":["df_2019_full <- bind_rows(df_2019_q1, df_2019_q2, df_2019_q3, df_2019_q4)\n","df_2020_full <- bind_rows(df_2020_q1, df_2020_q2, df_2020_q3, df_2020_q4)"]},{"cell_type":"markdown","id":"bb02a9a2","metadata":{"papermill":{"duration":0.012998,"end_time":"2025-06-18T13:15:31.087262","exception":false,"start_time":"2025-06-18T13:15:31.074264","status":"completed"},"tags":[]},"source":["## 2.4 Preparation Summary\n","* Imported the necessary R libraries to support data manipulation, visualization, and analysis in later phases.\n","* Loaded quarterly trip datasets from Q1 2019 to Q4 2020.\n","* Merged the quarterly files into two consolidated datasets: one for 2019 and one for 2020.\n","* Standardized column names across all datasets to ensure consistency and prevent join errors.\n","* Removed irrelevant or unused columns to simplify the analysis.\n","* Renamed key variables using clear and descriptive column names for better readability and interpretation."]},{"cell_type":"markdown","id":"5d2d1732","metadata":{"papermill":{"duration":0.011239,"end_time":"2025-06-18T13:15:31.110056","exception":false,"start_time":"2025-06-18T13:15:31.098817","status":"completed"},"tags":[]},"source":["# 3. Data Processing\n","In this project, I used **R** for data cleaning, processing, and transformation due to its powerful ability to handle large datasets efficiently, such as **dplyr**, **ggplot2**, and **tidyr** — provide robust tools for data manipulation and visualization.\n","\n","After conducting a thorough investigation to ensure data integrity, the following actions were taken to clean and prepare the dataset for further analysis:"]},{"cell_type":"markdown","id":"c15656ac","metadata":{"papermill":{"duration":0.011047,"end_time":"2025-06-18T13:15:31.132076","exception":false,"start_time":"2025-06-18T13:15:31.121029","status":"completed"},"tags":[]},"source":["## 3.1 Cleaning and Handling Missing Values\n","**The data cleaning process involves several essential steps to ensure data quality and reliability:**\n","\n","1. **Remove Noise:** Eliminate unnecessary elements such as extra spaces, invalid characters, and unwanted symbols from the dataset.\n","\n","2. **Remove Duplicates:** Identify and delete duplicate records, as they can distort the analysis and negatively impact the project outcomes.\n","\n","3. **Fix Data Entry Errors:** Correct incorrect entries such as wrong IDs or names, and standardize values (e.g., formatting names consistently) where necessary to maintain uniformity.\n","\n","4. **Handle Missing Data:** Address missing values by either filling them (using appropriate techniques) or, if not feasible, deciding whether to remove them or retain them based on their impact on the project goals."]},{"cell_type":"markdown","id":"a245eb00","metadata":{"papermill":{"duration":0.011074,"end_time":"2025-06-18T13:15:31.154171","exception":false,"start_time":"2025-06-18T13:15:31.143097","status":"completed"},"tags":[]},"source":["### Remove Noise"]},{"cell_type":"code","execution_count":7,"id":"fa5aa104","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:15:31.18371Z","iopub.status.busy":"2025-06-18T13:15:31.181866Z","iopub.status.idle":"2025-06-18T13:15:40.457665Z","shell.execute_reply":"2025-06-18T13:15:40.455256Z"},"papermill":{"duration":9.295275,"end_time":"2025-06-18T13:15:40.46267","exception":false,"start_time":"2025-06-18T13:15:31.167395","status":"completed"},"tags":[]},"outputs":[],"source":["# Trim string and remove extra spaces\n","df_2019_full <- df_2019_full %>%\n","  mutate(across(where(is.character), str_trim))\n","\n","df_2020_full <- df_2020_full %>%\n","  mutate(across(where(is.character), str_trim))"]},{"cell_type":"code","execution_count":8,"id":"195fd459","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:15:40.490256Z","iopub.status.busy":"2025-06-18T13:15:40.48849Z","iopub.status.idle":"2025-06-18T13:16:47.711066Z","shell.execute_reply":"2025-06-18T13:16:47.709273Z"},"papermill":{"duration":67.239967,"end_time":"2025-06-18T13:16:47.714239","exception":false,"start_time":"2025-06-18T13:15:40.474272","status":"completed"},"tags":[]},"outputs":[],"source":["# Clean the station names of any extra symbols\n","clean_station_name <- function(name) {\n","  name %>%\n","    tolower() %>%\n","    str_replace_all(\"\\\\(\\\\*\\\\)\", \"\") %>%\n","    str_replace_all(\"[[:punct:]]\", \" \") %>%\n","    str_replace_all(\"\\\\s+\", \" \") %>%\n","    str_replace_all(\"\\\\btemp\\\\b\", \"\") %>%\n","    str_trim()\n","}\n","\n","for (year in 19:20) {\n","    df_name <- paste0(\"df_20\", year, \"_full\")\n","    df <- get(df_name)\n","    \n","    df <- df %>%\n","      mutate(\n","        from_station_name = clean_station_name(from_station_name),\n","        to_station_name = clean_station_name(to_station_name)\n","      )\n","    \n","    assign(df_name, df, envir = .GlobalEnv)\n","  }"]},{"cell_type":"markdown","id":"d53391da","metadata":{"papermill":{"duration":0.013258,"end_time":"2025-06-18T13:16:47.741699","exception":false,"start_time":"2025-06-18T13:16:47.728441","status":"completed"},"tags":[]},"source":["### Remove Duplicates\n","To do this, I excluded the primary key (ride_id) because it is unique for every record. Including it would always result in zero duplicates since it serves only as an identifier and is not relevant for this analysis."]},{"cell_type":"code","execution_count":9,"id":"05e12c44","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:16:47.768521Z","iopub.status.busy":"2025-06-18T13:16:47.767049Z","iopub.status.idle":"2025-06-18T13:17:51.100663Z","shell.execute_reply":"2025-06-18T13:17:51.098643Z"},"papermill":{"duration":63.349892,"end_time":"2025-06-18T13:17:51.103658","exception":false,"start_time":"2025-06-18T13:16:47.753766","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["df_2019_full: 115 \n"]},{"name":"stdout","output_type":"stream","text":["df_2020_full: 523 \n"]}],"source":["# Check duplicated records \n","cat(\"df_2019_full:\", sum(duplicated(df_2019_full)), \"\\n\")\n","cat(\"df_2020_full:\", sum(duplicated(df_2020_full)), \"\\n\")"]},{"cell_type":"code","execution_count":10,"id":"d704eea3","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:17:51.163714Z","iopub.status.busy":"2025-06-18T13:17:51.162216Z","iopub.status.idle":"2025-06-18T13:18:44.328705Z","shell.execute_reply":"2025-06-18T13:18:44.326894Z"},"papermill":{"duration":53.217723,"end_time":"2025-06-18T13:18:44.332596","exception":false,"start_time":"2025-06-18T13:17:51.114873","status":"completed"},"tags":[]},"outputs":[],"source":["# Excluding Duplicate Records\n","df_2019_full <- df_2019_full[!duplicated(df_2019_full), ]\n","df_2020_full <- df_2020_full[!duplicated(df_2020_full), ]"]},{"cell_type":"markdown","id":"33fc57e3","metadata":{"papermill":{"duration":0.011022,"end_time":"2025-06-18T13:18:44.357591","exception":false,"start_time":"2025-06-18T13:18:44.346569","status":"completed"},"tags":[]},"source":["### Invalid Entries / Logical Errors\n","Inconsistencies were found where a single station ID was associated with multiple station names. These entries need to be standardized to ensure consistency and avoid ambiguity during analysis."]},{"cell_type":"code","execution_count":11,"id":"fd4f6f41","metadata":{"execution":{"iopub.execute_inpu