e)\n","\n","    # Get the most common name for each from_station_id\n","    to_station_map <- df %>%\n","      group_by(to_station_id) %>%\n","      summarise(most_common_name = get_mode(to_station_name))\n","    \n","    # Replace old names with the most common name by joining\n","    df <- df %>%\n","      select(-to_station_name) %>%\n","      left_join(to_station_map, by = \"to_station_id\") %>%\n","      rename(to_station_name = most_common_name)\n","    \n","    # Assign the cleaned dataframe back to original variable\n","    assign(df_name, df, envir = .GlobalEnv)\n","    \n","    # Check duplicates count\n","    duplicates_count <- df %>%\n","      group_by(to_station_id) %>%\n","      summarise(name_count = n_distinct(to_station_name)) %>%\n","      filter(name_count > 1) %>%\n","      count() %>%\n","      pull(n)\n","    \n","    cat(df_name, \"has\", duplicates_count, \"to_station_id groups with >1 unique to_station_name\\n\")\n","  }\n"]},{"cell_type":"code","execution_count":13,"id":"e4d94b65","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:19:00.021505Z","iopub.status.busy":"2025-06-18T13:19:00.019941Z","iopub.status.idle":"2025-06-18T13:19:00.125874Z","shell.execute_reply":"2025-06-18T13:19:00.123871Z"},"papermill":{"duration":0.122511,"end_time":"2025-06-18T13:19:00.128806","exception":false,"start_time":"2025-06-18T13:19:00.006295","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Dataframe: df_2019_full \n","No missing from_station_id found.\n","\n","Dataframe: df_2020_full \n","  from_station_name\n","1                  \n","\n"]}],"source":["for (year in 19:20) {\n","    df_name <- paste0(\"df_20\", year, \"_full\") \n","    df <- get(df_name)\n","    \n","    missing_id_stations <- df %>%\n","      filter(is.na(from_station_id)) %>%       # filter rows where ID is NA\n","      select(from_station_name) %>%             # select only station names\n","      distinct()                       