erage ride length by user type and day of week (wide)\n","  avg_ride_by_user_day <- df %>%\n","    group_by(user_type, start_day) %>%\n","    summarise(avg_ride_length = mean(trip_duration, na.rm = TRUE), .groups = \"drop\") %>%\n","    pivot_wider(names_from = start_day, values_from = avg_ride_length)\n","  cat(\"\\nAverage Ride Length by User and Day of Week:\\n\")\n","  head(avg_ride_by_user_day)\n","  \n","  # Count of rides by user type and day of week (wide)\n","  ride_count_by_user_day <- df %>%\n","    group_by(user_type, start_day) %>%\n","    summarise(ride_count = n(), .groups = \"drop\") %>%\n","    pivot_wider(names_from = start_day, values_from = ride_count)\n","  cat(\"\\nCount of Rides by User and Day of Week:\\n\")\n","  head(ride_count_by_user_day)\n","  \n","  cat(\"\\n--------------------------------------------\\n\")\n","\n","get_mode <- function(x) {\n","  uniqx <- unique(x)\n","  uniqx[which.max(tabulate(match(x, uniqx)))]\n","}\n","\n","  df <- df_full_year %>% filter(start_year == 2020)\n","  \n","  cat(\"\\n### Summary for 2020\", \"\\n\\n\")\n","  \n","  # Average ride length by user type\n","  avg_ride_by_user <- df %>%\n","    group_by(user_type) %>%\n","    summarise(\n","      avg_ride_length = mean(trip_duration, na.rm = TRUE), \n","      mode_day = get_mode(start_day),\n","      max_ride = max(trip_duration, na.rm = TRUE)\n","    )\n","  cat(\"Average Ride Length by User Type:\\n\")\n","  head(avg_ride_by_user)\n","  \n","  # Average ride length by user type and day of week (wide)\n","  avg_ride_by_user_day <- df %>%\n","    group_by(user_type, start_day) %>%\n","    summarise(avg_ride_length = mean(trip_duration, na.rm = TRUE), .groups = \"drop\") %>%\n","    pivot_wider(names_from = start_day, values_from = avg_ride_length)\n","  cat(\"\\nAverage Ride Length by User and Day of Week:\\n\")\n","  head(avg_ride_by_user_day)\n","  \n","  # Count of rides by user type and day of week (wide)\n","  ride_count_by_user_day <- df %>%\n","    group_by(user_type, start_day) %>%\n","    summarise(ride_count = n(), .groups = \"drop\") %>%\n","    pivot_wider(names_from = start_day, values_from = ride_count)\n","  cat(\"\\nCount of Rides by User and Day of Week:\\n\")\n","  head(ride_count_by_user_day)\n","  \n","  cat(\"\\n--------------------------------------------\\n\")\n"]},{"cell_type":"markdown","id":"7d2a73f1","metadata":{"papermill":{"duration":0.014122,"end_time":"2025-06-18T13:19:45.172305","exception":false,"start_time":"2025-06-18T13:19:45.158183","status":"completed"},"tags":[]},"source":["## 5.1 Usage Patterns\n","\n","The **ride count by user and day of the week** highlights differences in riding patterns. Casual riders take significantly more rides on weekends, peaking on Saturdays and Sundays, indicating a preference for leisure riding during non-working days. On the other hand, members maintain high ride volumes throughout the entire week, with particularly strong usage on weekdays such as Wednesday and Friday. This pattern supports the idea that members use the service as part of their daily routine, likely for commuting or regular errands."]},{"cell_type":"code","execution_count":29,"id":"7d185778","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:19:45.205151Z","iopub.status.busy":"2025-06-18T13:19:45.203516Z","iopub.status.idle":"2025-06-18T13:19:47.869974Z","shell.execute_reply":"2025-06-18T13:19:47.868116Z"},"papermill":{"duration":2.685548,"end_time":"2025-06-18T13:19:47.8722","exception":false,"start_time":"2025-06-18T13:19:45.186652","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABpAAAALQCAIAAAAYVqTpAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2AU5dqH8Xt2djfZ9AYkdEJHOtI7FoqA2FBArOBRUVFBbKBiPSKC3fMqdkVU\nFCwogiigSBEFUQi995JA2mbrvB9mE0KyqSTZSXL9PpwzmeeZmXtnZvHJP1MUTdMEAAAAAAAA\ngDGYAl0AAAAAAAAAgLMI7AAAAAAAAAADIbADAAAAAAAADITADgAAAAAAADAQAjsAAAAAAADA\nQAjsAAAAAAAAAAMhsAMAAAAAAAAMhMAOAAAAAAAAMBACOwAAzsstCWFKtsYjlwS6nGIZGhui\nFMpksk