ength by user type\n","  avg_ride_by_user <- df %>%\n","    group_by(user_type) %>%\n","    summarise(avg_ride_length = mean(trip_duration, na.rm = TRUE))\n","  \n","  p1 <- ggplot(avg_ride_by_user, aes(x = user_type, y = avg_ride_length, fill = user_type)) +\n","     geom_col() +\n","    geom_text(aes(label=paste0(round(avg_ride_length, 0), \" min\")),  vjust=1.6, color=\"white\", position = position_dodge(0.8), size=6.5) +\n","    labs(title = paste( yr),\n","         x = \"\", y = \"\") +\n","    theme_minimal() +\n","    theme(legend.position = \"none\")\n","  plots_avg_user[[as.character(yr)]] <- p1\n","}\n","\n","options(repr.plot.width = 14, repr.plot.height = 6)\n","# Display plots side-by-side for each summary type\n","wrap_plots(plots_avg_user, nrow = 1) + \n","  plot_annotation(title = \"Avg Ride Length by User Type\") &\n","  theme(\n","    plot.title = element_text(size = 20, hjust = 0.5),\n","    axis.title.x = element_text(size = 18),  \n","    axis.title.y = element_text(size = 18),\n","    axis.text.x = element_text(size = 16),\n","    axis.text.y = element_text(size = 16)\n","  )"]},{"cell_type":"markdown","id":"3094cd50","metadata":{"papermill":{"duration":0.015479,"end_time":"2025-06-18T13:19:47.90479","exception":false,"start_time":"2025-06-18T13:19:47.889311","status":"completed"},"tags":[]},"source":["The **average ride length** for casual riders was about 57 minutes in 2019, dropping to nearly 48 minutes in 2020. For members, the average ride duration was around 14 minutes in 2019, increasing slightly to 16 minutes in 2020. In 2019, casual riders spent about four times longer riding compared to members; this ratio decreased to three times longer in 2020. These duration patterns likely reflect different usage purposes; casual riders probably use biking for leisure, sports, or to avoid traffic, benefiting from the flexibility and speed that bikes offer compared to buses or cars. In contrast, members tend to have shorter rides averaging around 15 minutes, suggesting their trips are primarily for commuting to work, university, or school. Supporting this, member ride counts are higher on weekdays than weekends, reflecting typical commuter patterns. In contrast, casual riders mostly ride during weekends, reinforcing the idea of leisure or recreational use. "]},{"cell_type":"code","execution_count":30,"id":"7885d1f7","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:19:47.937645Z","iopub.status.busy":"2025-06-18T13:19:47.936072Z","iopub.status.idle":"2025-06-18T13:19:53.281187Z","shell.execute_reply":"2025-06-18T13:19:53.278285Z"},"papermill":{"duration":5.366024,"end_time":"2025-06-18T13:19:53.285495","exception":false,"start_time":"2025-06-18T13:19:47.919471","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABpAAAALQCAIAAAAYVqTpAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2AU1dvG4Weyu+mVBEjohCqCSO/SRIoUC4Kg2PFVUZEqIlJEQZGqqH8VsWND\nxYIiiBRFiiiIdOm9pbft836YTQjJpm+yQ/K7vjCZOTPnmd3ZcPbOFEVVVQEAAAAAAACgDz7e\nLgAAAAAAAADAZQR2AAAAAAAAgI4Q2AEAAAAAAAA6QmAHAAAAAAAA6AiBHQAAAAAAAKAjBHYA\nAAAAAACAjhDYAQAAAAAAADpCYAcAAAAAAADoCIEdAAAFeCAmWMlUb8hqb5dTKP0jA5V8+fj4\nhkVWadC84/CR477auD+v7UysGaq1P2ZxFL53e8Z+ba2Iegs8sTf5SfjvQa2voMp3lHZfevNT\nh2ravi+7mO6pbaaff1fbZo3uP3tqm8VgSVqXdaxa1ILbx+27XWscEjOy9Ku7WuX3C8HgV6Va\n7eatuzzyzJw1f53wdqUAAIDADgCAfGVc/Oy9c2lZP55cOSbDWYj8QPdU1ZYcf/HQrs2fLpk/\nuOs11w4ad9hchEgOQGly/v7FoqF9OsZEhfv6B9eo1+Kux2duP+OxWDY31Wm9ePbErr9+f+ul\np29qXbvd0Kd3xllKrzsAAFAgo7cLAABA1/bMnZ39R1v63sl74hc0i/RWPUVV9fo2df0Nuefb\nzOlxZ48dO5+s/bj3u/kdulhObVvsq5RtfSiINWXLtS1HiEhE/Te2/dTL2+Wg1DntcRMGtZ//\n46GsOaeP7Fz2+s4v3l0yZ/W2MV2qlryLhq3bVjJe8Wd7c0rCubMnz8W7MsFtX8zpsGb9d//+\n2qt6UMm7AwAAxUBgBwBAPtRn3zmoTdWqF3LicIqIfDVhw4JVt3m1qiIYvHz14nrheS09t2fd\n5IeHvffHeRG5uP31e76d8NkttbM36PLQKFuiWURCDZyV7x2qM+PQoUMiEuWbVmBjlAPvD2k7\n/8cjIhJSp+uo+/vXCbNtW7Ns6crddvOJiTe173HpYPMgUwm7mL1q/W2RAbnnH92xbtlbL894\ne7VNVc0J2wY07fHPmU2NAvi+AACAFzD4BgAgTykn5q1OMIuIwTfmp0+HaTPPrn8qwV4erooV\nkehruy9Zt7N