"  plot_annotation(title = \"Avg Ride Length by User & Day\") &\n","  theme(\n","    plot.title = element_text(size = 20, hjust = 0.5),\n","    axis.title.x = element_text(size = 18),  \n","    axis.title.y = element_text(size = 18),\n","    axis.text.x = element_text(size = 16),\n","    axis.text.y = element_text(size = 16)\n","  )\n"]},{"cell_type":"markdown","id":"8b25dfd7","metadata":{"papermill":{"duration":0.01773,"end_time":"2025-06-18T13:19:53.324609","exception":false,"start_time":"2025-06-18T13:19:53.306879","status":"completed"},"tags":[]},"source":["**The average ride length by user type and day of the week** reveals a clear distinction between casual riders and members. Casual users show noticeable fluctuations across weekdays, and when comparing 2019 to 2020, the trend appears reversed—peak days in 2019 are not peak days in 2020. Casual riders consistently take longer trips, averaging between 53 and 60 minutes in 2019, and between 43 and 55 minutes in 2020. In contrast, members maintain shorter and more consistent ride durations, typically ranging from 13 to 16 minutes in 2019 and from 14 to 18 minutes in 2020. This pattern suggests that casual users are more likely to ride for recreational purposes—especially on weekends—whereas members tend to use the service for shorter, utilitarian trips such as commuting."]},{"cell_type":"code","execution_count":31,"id":"79bc61d5","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:19:53.365934Z","iopub.status.busy":"2025-06-18T13:19:53.364252Z","iopub.status.idle":"2025-06-18T13:19:57.873877Z","shell.execute_reply":"2025-06-18T13:19:57.871065Z"},"papermill":{"duration":4.535735,"end_time":"2025-06-18T13:19:57.877261","exception":false,"start_time":"2025-06-18T13:19:53.341526","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABpAAAALQCAIAAAAYVqTpAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd4DT5BvA8Sft9fYewLH3XrKUJagIuAFloyII/lyoOMANCi5QENwDFVEQFEGG\nKOJAAQVEZG+QPW/P3