  day_group = ifelse(start_day %in% c(\"Saturday\", \"Sunday\"), \"Weekend\", \"Weekday\"),\n","      ride_date = as.Date(start_time)\n","    )\n","\n","  # Count rides per user, day group, and date\n","  daily_counts <- df %>%\n","    group_by(user_type, day_group, ride_date) %>%\n","    summarise(daily_count = n(), .groups = \"drop\")\n","\n","  # Average number of rides per day\n","  avg_ride_count <- daily_counts %>%\n","    group_by(user_type, day_group) %>%\n","    summarise(avg_daily_rides = mean(daily_count), .groups = \"drop\")\n","\n","  # Plot\n","  p3 <- ggplot(avg_ride_count, aes(x = day_group, y = avg_daily_rides, fill = user_type)) +\n","    geom_col(position = \"dodge\") +\n","    labs(title = paste(yr),\n","         x = \"Day Group\", y = \"Average Rides per Day\") +\n","    theme_minimal()\n","\n","  plots_avg_count_user_day[[as.character(yr)]] <- p3\n","}\n","\n","# Combine plots\n","options(repr.plot.width = 14, repr.plot.height = 6)\n","wrap_plots(plots_avg_count_user_day, nrow = 1) + \n","  plot_annotation(title = \"Average Daily Ride Count by User: Weekdays vs Weekends\") &\n","  theme(\n","    plot.title = element_text(size = 18, hjust = 0.5),\n","    axis.title.x = element_text(size = 18),  \n","    axis.title.y = element_text(size = 18),\n","    axis.text.x = element_text(size = 16),\n","    axis.text.y = element_text(size = 16)\n","  )\n"]},{"cell_type":"markdown","id":"ee2b4742","metadata":{"papermill":{"duration":0.017818,"end_time":"2025-06-18T13:19:57.912898","exception":false,"start_time":"2025-06-18T13:19:57.89508","status":"completed"},"tags":[]},"source":["**The average daily ride counts by user type across weekdays and weekends** for 2019 and 2020 reveal a significant shift in usage patterns. In 2019, member usage was dominant, especially on weekdays, averaging around 9,000 rides per day, compared to only about 2,000 rides by casual users. This suggests that members primarily used the service for commuting or routine weekday activities, while casual users were more active on weekends, likely for recreational purposes. However, in 2020, a clear change occurred. Member usage dropped notably on weekdays, likely due to the impact of the COVID-19 pandemic and a reduction in daily commuting. Meanwhile, casual usage surged—especially on weekends—reaching nearly 6,000 rides per day, almost matching or even surpassing member activity. This shift indicates a broader transition in how the service was used, moving from being predominantly utilitarian in 2019 to more recreational in 2020, particularly among casual users."]},{"cell_type":"code","execution_count":32,"id":"15e04c4e","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:19:57.952229Z","iopub.status.busy":"2025-06-18T13:19:57.9505Z","iopub.status.idle":"2025-06-18T13:20:02.057767Z","shell.execute_reply":"2025-06-18T13:20:02.055976Z"},"papermill":{"duration":4.130821,"end_time":"2025-06-18T13:20:02.061086","exception":false,"start_time":"2025-06-18T13:19:57.930265","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["\n","### Summary for Winter (2019 & 2020)\n","\n"]},{"name":"stdout","output_type":"stream","text":["Average Ride Length by Year and User Type:"]},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 4 × 5</caption>\n","<thead>\n","\t<tr><th scope=col>start_year</th><th scope=col>user_type</th><th scope=col>avg_ride_length</th><th scope=col>mode_day</th><th scope=col>max_ride</th></tr>\n","\t<tr><th scope=col>&lt;int&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2019</td><td>Casual</td><td> 68.89759</td><td>Sunday  </td><td>177200</td></tr>\n","\t<tr><td>2019</td><td>Member</td><td> 12.74951</td><td>Thursday</td><td> 94162</td></tr>\n","\t<tr><td>2020</td><td>Casual</td><td>144.44534</td><td>Sunday  </td><td>156450</td></tr>\n","\t<tr><td