e(\n","      avg_ride_length = mean(trip_duration, na.rm = TRUE),\n","      mode_day = get_mode(start_day),\n","      max_ride = max(trip_duration, na.rm = TRUE),\n","      .groups = \"drop\"\n","    )\n","  cat(\"Average Ride Length by Year and User Type:\")\n","  head(avg_ride_by_user)\n","  \n","  # Average ride length by year, user type and day of week (wide)\n","  avg_ride_by_user_day <- df_season %>%\n","    group_by(start_year, user_type, start_day) %>%\n","    summarise(avg_ride_length = mean(trip_duration, na.rm = TRUE), .groups = \"drop\") %>%\n","    pivot_wider(names_from = start_day, values_from = avg_ride_length)\n","  cat(\"\\n\\nAverage Ride Length by Year, User and Day of Week:\")\n","  head(avg_ride_by_user_day)\n","  \n","  # Count of rides by year, user type and day of week (wide)\n","  ride_count_by_user_day <- df_season %>%\n","    group_by(start_year, user_type, start_day) %>%\n","    summarise(ride_count = n(), .groups = \"drop\") %>%\n","    pivot_wider(names_from = start_day, values_from = ride_count)\n","  cat(\"\\n\\nCount of Rides by Year, User and Day of Week:\")\n","  head(ride_count_by_user_day)\n","  \n","  cat(\"\\n--------------------------------------------\\n\")\n"]},{"cell_type":"markdown","id":"da9c644b","metadata":{"papermill":{"duration":0.021558,"end_time":"2025-06-18T13:20:02.103912","exception":false,"start_time":"2025-06-18T13:20:02.082354","status":"completed"},"tags":[]},"source":["## 5.2 Temporal and Seasonal Trends\n","**The Average Ride Length by Year and User Type**\n","* **Winter:** Casual riders in 2020 had a significant increase in average ride length compared to 2019 (144.45 mins vs. 68.90 mins). However, Member riders maintained a relatively consistent average duration (12.75 mins in 2019 vs. 11.57 mins in 2020). Moreover, Sunday remained the most popular day for casual users, while Tuesday and Thursday the most popular day for members.\n","  \n","* **Spring:** The average ride length for casual riders slightly increased from 50.77 mins in 2019 to 58.01 mins in 2020. Members also showed an increase in average duration (13.06 mins in 2019 to 17.60 mins in 2020). Saturday emerged as the most common ride day for both user types in 2020.\n","\n","* **Summer:** Casual riders’ average duration dropped slightly in 2020 (51.53 mins) compared to 2019 (58.37 mins). On the other hand, Member riders had a small increase in ride duration (15.28 mins to 17.18 mins), maintaining their weekday riding preference. Saturday continued to be the most common ride day for casual users.\n","\n","* **Autumn:** Casual riders experienced a decrease in average ride length in 2020 (35.35 mins) compared to 2019 (54.87 mins). While members had a slight increase in ride length from 12.91 mins to 14.15 mins, showing consistency across the seasons.\n","\n","**Count of Rides by Year, User and Day of Week**\n","\n","* **Winter:** Members consistently had more rides than casual users across all days in both years. 2020 saw a slight drop in member rides but casual usage remained similar, with Sundays being the most popular day for casual riders.\n","\n","* **Spring:** Member usage dropped noticeably in 2020, while casual rider activity stayed relatively stable. Both groups favored weekends, especially Saturdays and Sundays.\n","\n","* **Summer:** Casual ridership increased sharply in 2020 compared to 2019, especially on weekends. Member rides dropped across all days but remained higher than casual rides on weekdays.\n","\n","*  **Autumn:** Casual rides grew in 2020, while member usage declined slightly. Weekends remained popular for casual users, and members maintained high usage across weekdays."]},{"cell_type":"code","execution_count":33,"id":"c068297d","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:20:02.150483Z","iopub.status.busy":"2025-06-18T13:20:02.148873Z","iopub.status.idle":"2025-06-18T13:20:04.486056Z","shell.execute_reply":"2025-06-18T13:20:04.483021Z"},"papermill":{"duration":2.36