<- df_full_year %>% \n","  filter(start_year == 2020) %>%\n","  mutate(\n","    day_type = if_else(start_day %in% c(\"Saturday\", \"Sunday\"), \"Weekend\", \"Weekday\"),\n","    day_type = factor(day_type, levels = c(\"Weekday\", \"Weekend\"))\n","  )\n","\n","df_2020$season <- factor(df_2020$season, levels = c(\"Winter\", \"Spring\", \"Summer\", \"Autumn\"))\n","\n","# Plot 1: Avg ride length by user and season (unchanged)\n","avg_ride_by_user_season <- df_2020 %>%\n","  group_by(user_type, season) %>%\n","  summarise(avg_ride_length = mean(trip_duration, na.rm = TRUE), .groups = \"drop\")\n","\n","p1 <- ggplot(avg_ride_by_user_season, aes(x = season, y = avg_ride_length, fill = user_type)) +\n","  geom_col(position = \"dodge\") +\n","  labs(title = \"Average Ride Length by User Type and Season (2020)\",\n","       x = \"Season\", y = \"Avg Ride Length (min)\") +\n","  theme_minimal()\n","\n","# Plot 2: Ride count by user, day type, and season\n","ride_count_by_user_daytype_season <- df_2020 %>%\n","  group_by(user_type, day_type, season) %>%\n","  summarise(ride_count = n(), .groups = \"drop\")\n","\n","p2 <- ggplot(ride_count_by_user_daytype_season, aes(x = season, y = ride_count, fill = user_type)) +\n","  geom_col(position = \"dodge\") +\n","  facet_wrap(~day_type) +\n","  labs(title = \"Ride Count by User, Day Type and Season (2020)\",\n","       x = \"Season\", y = \"Number of Rides\") +\n","  theme_minimal()\n","\n","# Example: increasing font sizes for plot 1\n","p1 <- p1 + theme(\n","  plot.title = element_text(size = 20, hjust = 0.5),\n","  axis.title.x = element_text(size = 16),\n","  axis.title.y = element_text(size = 16),\n","  axis.text.x = element_text(size = 14),\n","  axis.text.y = element_text(size = 14)\n",")\n","\n","# And plot 3\n","p2 <- p2 + theme(\n","  plot.title = element_text(size = 20, hjust = 0.5),\n","  axis.title.x = element_text(size = 16),\n","  axis.title.y = element_text(size = 16),\n","  axis.text.x = element_text(size = 14),\n",