text(size = 20, hjust = 0.5),\n","    axis.title.x = element_text(size = 14),\n","    axis.title.y = element_text(size = 14),\n","    axis.text.x = element_text(size = 10, angle = 45, hjust = 1),\n","    axis.text.y = element_text(size = 10),\n","    legend.title = element_text(size = 12),\n","    legend.text = element_text(size = 10),\n","    strip.text = element_text(size = 14, face = \"bold\")\n","  )\n"]},{"cell_type":"markdown","id":"10f64d0d","metadata":{"papermill":{"duration":0.03319,"end_time":"2025-06-18T13:20:06.817543","exception":false,"start_time":"2025-06-18T13:20:06.784353","status":"completed"},"tags":[]},"source":["Both members and casual riders exhibit similar behavior on weekends, with approximately the same average ride duration. They follow similar trends across seasons, though the volume of rides varies.\n","\n","* In summer, the peak riding hours are between 10 AM and 6 PM.\n","\n","* Winter is an exception, where the ride durations remain fairly constant throughout the day, resulting in a nearly flat line with no clear peaks.\n","\n","* Other seasons generally follow this pattern, with differences mainly in the ride counts rather than the trend shape.\n","\n","Looking at casual riders specifically, their peak usage tends to occur between 5 PM and 6 PM, while winter again shows little variation. In contrast, members display two distinct peaks in their riding pattern: one in the morning between 7 AM and 8 AM, and another in the evening between 5 PM and 6 PM, indicating clear commuting-related trends."]},{"cell_type":"code","execution_count":35,"id":"cebfe0b9","metadata":{"execution":{"iopub.execute_input":"2025-06-18T13:20:06.893611Z","iopub.status.busy":"2025-06-18T13:20:06.891111Z","iopub.status.idle":"2025-06-18T13:20:11.096696Z","shell.execute_reply":"2025-06-18T13:20:11.093916Z"},"papermill":{"duration":4.241259,"end_time":"2025-06-18T13:20:11.100655","exception":false,"start_time":"2025-06-18T13:20:06.859396","status":"completed"},"tags"