AAACZCYQcAAAAAAACYCIUdAAAA\nAAAAYCIUdgAAAAAAAICJUNgBAAAAAAAAJkJhBwAAAAAAAJgIhR0AAAAAAABgIhR2AAAAAAAA\ngIlQ2AEAAAAAAAAmQmEHAAAAAAAAmAiFHQAAAAAAAGAiFHYAAAAAAACAiVDYAQAAAAAAACZC\nYQcAAAAAAACYCIUdAAAAAAAAYCIUdgAAAAAAAICJUNgBAAAAAAAAJkJhBwAAAAAAAJgIhR0A\nAAAAAABgIhR2AAAAAAAAgIlQ2AEAAAAAAAAmQmEHAAAAAAAAmAiFHQAAAAAAAGAiFHYAAAAA\nAACAiVDYAQAAAAAAACZCYQcAAAAAAACYCIUdAAAAAAAAYCIUdgAAAAAAAICJUNgBAAAAAAAA\nJkJhBwAAAAAAAJgIhR0AAAAAAABgIhR2AAAAAAAAgIlQ2AEAAAAAAAAmQmEHAAAAAAAAmAiF\nHQAAAAAAAGAiFHYAAAAAAACAiVDYAQAAAAAAACZCYQcAAAAAAACYCIUdAAAAAAAAYCIUdgAA\nAAAAAICJUNgBAAAAAAAAJkJhBwAAAAAAAJgIhR0AAAAAAABgIhR2AAAAAAAAgIlQ2AEAAAAA\nAAAmQmEHAAAAAAAAmAiFHQAAAAAAAGAiFHYAAAAAAACAiVDYAQAAAAAAACZCYQcAAAAAAACY\nCIUdAAAAAAAAYCIUdgAAAAAAAICJUNgBAAAAAAAAJvL/AQMH0Iy+47qDAAAAAElFTkSuQmCC\n"},"metadata":{"image/png":{"height":360,"width":840}},"output_type":"display_data"}],"source":["# Create a list to store plots\n","plot_list <- list()\n","\n","for (yr in years) {\n","  subset_df <- df_full_year %>% filter(start_year == yr)\n","  \n","  usertype_counts <- subset_df %>%\n","    count(user_type) %>%\n","    mutate(percent = n / sum(n) * 100,\n","           label = paste0(user_type, \" (\", round(percent, 0), \"%)\"))\n","  \n","  p <- ggplot(usertype_counts, aes(x = \"\", y = percent, fill = user_type)) +\n","    geom_col(width = 1, color = \"white\") +\n","    coord_polar(theta = \"y\") +\n","    theme_void() +\n","    labs(title = paste( yr)) +\n","    geom_text(aes(label = label), position = position_stack(vjust = 0.5), size = 5) +\n","    scale_fill_manual(values = c(\"#F8766D\", \"#00BFC4\"))\n","  \n","  plot_list[[as.character(yr)]] <- p\n","}\n","\n","options(repr.plot.width = 14, repr.plot.height = 6)\n","# Then create your ggplots with bigger theme text sizes\n","wrap_plots(plot_list, nrow = 1) + \n","  plot_annotation(title = \"User Type Distribution by Year\") &\n","  theme(\n","    plot.title = element_text(size = 20, hjust = 0.5),\n","    legend.text = element_text(size = 16),\n","    legend.title = element_text(size = 17)\n","  )"]},{"cell_type":"markdown","id":"7ae0c54b","metadata":{"papermill":{"duration":0.029619,"end_time":"2025-06-18T13:20:11.161235","exception":false,"start_time":"2025-06-18T13:20:11.131616","status":"completed"},"tags":[]},"source":["**The pie charts display the proportion of rides by user type in 2019 and 2020:**\n","\n","* In 2019, members accounted for 77% of all rides, while casual riders made up 23%.\n","\n","* In 2020, casual usage increased significantly to 39%, and member usage dropped to 61%.\n","\n","This indicates a noticeable shift in user composition, with more casual users participating in 2020 compared to the previous year."]},{"cell_type":"markdown","id":"bc09bd82","metadata":{"papermill":{"duration":0.031643,"end_time":"2025-06-18T13:20:11.222665","exception":false,"start_time":"2025-06-18T13:20:11.191022","status":"completed"},"tags":[]},"source":["## 5.3 Insights and Observations\n","\n","**Casual riders and annual members demonstrate distinctly different usage patterns:**\n","\n","* **Ride Length:** Casual riders consistently take longer trips across all seasons, often riding for leisure, especially on weekends. In contrast, members ride shorter but more regular trips, likely for commuting or routine travel.\n","\n","* **Day Preference:** Casual riders are most active on weekends, particularly Saturdays and Sundays, while members show steady activity throughout the week, with peaks on weekdays.\n","\n","* **Seasonal Patterns:** Casual ride durations fluctuate more by season, peaking in warmer months (Spring/Summer), whereas member ride patterns are more stable year-round."]},{"cell_type":"markdown","id":"37cfb8dd","metadata":{"papermill":{"duration":0.028663,"end_time":"2025-06-18T13:20:11.280722","exception":false,"start_time":"2025-06-18T13:20:11.252059","status":"completed"},"tags":[]},"source":["## 5.4 Business Implications\n","\n","### How do casual riders and annual members behave differently?\n","\n","**Casual riders** tend to use the service for **longer**, **less frequent** and **recreational trips**, **often on weekends**. In contrast, **annual members** use bikes for **shorter**, **more frequent rides spread across the workweek**, suggesting routine or commuting behavior. This behavioral difference highlights an opportunity to tailor marketing and operational strategies to better convert casual riders into committed members."]},{"cell_type":"markdown","id":"f69a365b","metadata":{"papermill":{"duration":0.028742,"end_time":"2025-06-18T13:20:11.338111","exception":false,"start_time":"2025-06-18T13:20:11.309369","status":"completed"},"tags":[]},"source":["# 6. Conclusion\n","Based on the analysis, it is clear that casual riders and annual members use Cyclistic bikes in different ways. Casual riders tend to take longer, recreational trips, especially on weekends and during warmer seasons, while members ride shorter, more frequent trips, primarily on weekdays, likely for commuting or routine travel.\n","\n","These insights can help the business target casual riders more effectively by offering weekend promotions, seasonal incentives, or trial membership programs. Additionally, improving weekend availability and providing compelling membership offers could further encourage casual riders to convert to annual members.\n","\n","**As next steps, the marketing team could:**\n","* Design targeted campaigns that speak directly to casual riders' habits and motivations.\n","* Evaluate operational strategies to optimize bike distribution based on peak usage days and times by user type.\n","* Implement retention strategies to maintain and support the existing member base, as suggested by the decline in membership proportion from 77% in 2019 to 61% in 2020."]},{"cell_type":"code","execution_count":null,"id":"b8594016","metadata":{"papermill":{"duration":0.028837,"end_time":"2025-06-18T13:20:11.395906","exception":false,"start_time":"2025-06-18T13:20:11.367069","status":"completed"},"tags":[]},"outputs":[],"source":[]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1869364,"sourceId":3053264,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":397.388372,"end_time":"2025-06-18T13:20:11.947349","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2025-06-18T13:13:34.558977","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}